$(document).ready(function(){    
    $(".m").toggle(function(){
        var uih = $('.ui').height();
        var t = document.documentElement.scrollTop || document.body.scrollTop; 
        var h = uih - t;
        if(h < 400 ) h = 398;
        $('.muen').css({
            height : h+'px'
        }); 
        
        $('.muen').show();
        $(".ui").animate({
            left:'-75%'
        },200);
        $(".top").animate({
            left:'-75%'
        },200);
    },
    function(){
        $(".ui").animate({
            left:'0px'
        },200);
        $(".top").animate({
            left:'0px'
        },200);
        $('.muen').hide();
    }
  
    );        
    
    window.onscroll = function(){
        var t = document.documentElement.scrollTop || document.body.scrollTop;                 
        var h = $('.ui').height() - t;
        $('.muen').css({
            top : t+'px',
            height : h+'px'
        });
    }
    
});


